import troll from "../images/troll-face.png"

function Header() {
    return (
        <header className="header">
            <img alt="troll" src={troll} className="troll--image"/>
            <h1 className="meme">Meme Generator</h1>
            <h3 className="title">React Project</h3>
        </header>
    )
}

export default Header;
